import React from 'react'

interface Props {
  title: any;
  onClick: any;
  className: any;
  isDaytimee: Boolean;
}
//pink button that will be reused everywhere in the program
const PinkButton = ({title, onClick, className, isDaytimee}: Props) => {
  return (
    <button className={`${isDaytimee ? 'text-pink' : 'text-green-400'} font-bold border-blue border p-2 hover:bg-sky-200 hover:text-blue rounded-md duration-300 ease-out` +
        " " +
        className
      } onClick={onClick}>
        {title}
    </button>
  )
}

export default PinkButton
